const Footer = () => {
    console.log("footer")

    function refreshAd(){
        googletag.cmd.push(function() {
            googletag.pubads().refresh();
        })
    };

    return(
        <footer>
            <p>Footer</p>
            <button onClick={refreshAd}>
                Show/Refresh Ad
            </button>
            <div id="footer-ad"></div>
        </footer>

    )
};

export default Footer;
